//Procedimento que recebe duas vari�veis, uma que aponta para
//um array e outra que aponta para um inteiro com a posi��o do
//array a ser usada. O procedimento termina quando atinge a
//primeira posi��o depois dos par�nteses.
void casa_parenteses(char* array1, int* p) {
    int paren = 1;
    int c = *p;
    while (paren != 0) {
        switch (array1[c]) {
            case '(':
                paren++;
                c++;
                break;
            case ')':
                paren--;
                c++;
                break;
            default:
                c++;
        }
    }
    *p = c;
}

/*Procedimento pega a string de entrada e a partir da mesma cria o grafo
 * fazendo uma busca em ordem de baixo para cima
 * */
Celula* cria_grafo(char *entrada){

	Celula *raiz = cria_aplicacao();

	while(entrada[0] != '\0'){

			if(entrada[0] == ')'){
					return raiz;
			}
			else if(entrada[0] == '('){
				if(raiz->fdir != NULL){
					Celula *ap = cria_aplicacao();
					Celula *aux = raiz;
					ap->fesq = aux;
					ap->fdir = cria_grafo(entrada + 1);
					raiz = ap;
				}
				else{
					raiz->fdir= cria_grafo(entrada + 1);
				}
				int end   = 1;
				casa_parenteses(entrada,&end);
				for(int i = 0; i < end; i++){
					entrada++;
				}
			}
			else{
				if(raiz->fesq == NULL){
					Celula *comb = cria_combinador(entrada);
					raiz->fesq = comb;
					entrada++;
				}
				else if(raiz->fdir == NULL){
					Celula *comb = cria_combinador(entrada);
					raiz->fdir = comb;
					entrada++;
				}
				else{
					Celula *ap = cria_aplicacao();
					Celula *aux  = raiz;
					ap->fesq  = aux;
					raiz  = ap;
				}
			}
	}

	return raiz;
}

