/*Procedimento empilha c�lulas d�s de a raiz at� o elemento mais externo mais
 * a esquerda
 * */
void empilha_grafo(Celula *grafo){
	Celula *g = grafo;
	while(g != NULL){
		push(g);
		g = g->fesq;
	}
}

int maquina_ks(){
	/**
	 * Criação e alocação do grafo.
	 * */
	double clk_ps = (double)  CLOCKS_PER_SEC;
	clock_t toc = clock();
	Celula *grafo = cria_grafo(string);
	clock_t tic = clock();
	printf("\n");
	printf("Tempo Criação do grafo = %lf", (double)((tic - toc)/clk_ps));


	int iterations  = 0;
	toc = clock();
	double a = (double) toc;
	empilha_grafo(grafo);
	while(topo != NULL){
		//tipo = topo->dado->tipo;
		switch(topo->dado->tipo){
			case'K':
				reduz_K(grafo);
				break;
			case 'S':
				reduz_S(grafo);
				break;
		}
		iterations++;
	}
	tic = clock();
	double b = (double) tic;


	if(grafo != NULL){
		printf("\n\n%c\n\n",grafo->tipo);
	}
	printf("\n");
	printf("Tempo Redução grafo = %lf", (double)((b - a)/clk_ps));
	printf("\n\nNumero de iterações = %d\n",iterations);
	return 0;
}
